import React from "react";
import Inventory from "../../Data/inventory.json";

export default function ProductList() {
  Inventory.map(({ itemDetail, value }) => {
    return (
      <div id="gallery">
        <img src={itemDetail.images} />
      </div>
    );
  });
}
